import ReactDOM from "react-dom";
import React from "react";
import "./index.css";

const fName="Biswajit";
const link1="https://www.thapatechnical.com/";

ReactDOM.render(
<>
    <h1 className="heading">My name is {fName}</h1>
    <div>
    <a href={link1} target="_blank"><img src="https://picsum.photos/200/300" alt="img.info"/></a>
    <a href={link1} target="_blank"><img src="https://picsum.photos/250/300" alt="img.info"/></a>
    <a href={link1} target="_blank"><img src="https://picsum.photos/300/300" alt="img.info"/></a>
    </div>
</>,
    document.getElementById("root"))
